import { Box, Heading, Wrap, WrapItem } from "@chakra-ui/react";
import Pic from "../pic/pic.component";

export default function Pics(props) {
  const { title } = props;

  const items = [1, 2, 3, 4];

  return (
    <Box p={2}>
      <Heading color="gray.500" pb={3}>
        {title}
      </Heading>
      <Wrap justify="center">
        {items.map((item) => {
          return (
            <WrapItem>
              <Pic numero={item} />
            </WrapItem>
          );
        })}
      </Wrap>
    </Box>
  );
}
